  height: 100vh;
  width: 100vw;

  .background{
    position: absolute;
    top: 0;
    left: 0;
    height: 100vh;
    width: 100vw;
    margin-top: -20vh;
    background-image: linear-gradient(10deg, #f4c44a, #f44336, #f44336, #f44336);
    transform:skewY(-5deg);
    /* z-index: -9; */
  }

  @media only screen and (max-width: 767px) {
    .background{
    margin-top: -10vh;
  }
  }

  .foreground{
    padding-top: 60px;
  }

  .lobster{
    font-family: "Lobster Two", cursive;
  }

  .center {
    text-align: center;
  }

  .title{
    font-size: calc(3vw + 40px);
  }

  .subtitle{
    margin-top: -10px;
    font-size: calc(0.5vw + 10px);
  }

  .description-container{
    max-width: 400px;
    text-align: center;
    margin: auto;
  }

  .demo-component{
    height: auto;
    width: auto;
    display: inline-block;
    text-align: center;
    transform: scale(0.6);
